import * as React from "react";
import CustomButton from "../soundReact/customButton";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import ClickSound from "./clicksound.wav";


export default function SkillButton({ skill, linkTo }) {
  let audio = new Audio(ClickSound);
  const start = () => {
    audio.play()
};
 
  return (
    <div
      style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(140px, 1fr))",
        gridGap: "10px",
        padding: "10px",
        justifyItems: "center",
      }}
    >
      <Link to={linkTo}>
        <CustomButton 
          variant="contained"
          size="large"
          sx={{ minWidth: 180 }}
          sound= {start}
         
        >
          <Typography
            sx={{
              fontFamily: "Arial",
              fontSize: "19px",
              textTransform: "initial",
              whiteSpace: "nowrap",
            }}
          >
            {skill}
          </Typography>
        </CustomButton>
      </Link>
      
    </div>
  );
}
